import React from "react";
import {
  BarChart,
  Bar,
  XAxis,
  YAxis,
  Tooltip,
  Legend,
  ResponsiveContainer,
} from "recharts";

const CustomBarChart = ({ data }) => (
  <ResponsiveContainer width="100%" height={400}>
    <BarChart data={data}>
      <XAxis dataKey="range" />
      <YAxis />
      <Tooltip />
      <Legend />
      <Bar dataKey="count" fill="rgba(75,192,192,0.2)" />
    </BarChart>
  </ResponsiveContainer>
);

const BarChartData = ({ priceRanges }) => {
  const data = Object.entries(priceRanges || {}).map(([range, count]) => ({
    range,
    count,
  }));

  return (
    <div>
      <h2>Price Ranges Bar Chart</h2>
      <CustomBarChart data={data} />
    </div>
  );
};

export default BarChartData;
